// setTimeout(start, 1500000)
const startBtn = document.getElementById("start-btn")
let statusEl = document.getElementById("status-el")
let localLog = 0
let breaks = 0

startBtn.addEventListener("click", function(){
    if (localLog >= 4){
        statusEl.innerHTML = ""
        localLog = 0
    }

    localLog += + 1
    if (breaks >= 0 && breaks <= 2){
        breaks += + 1
        statusEl.innerHTML += `<li> 25 Mins, then 5 mins break :)</li>`
    } else if (breaks = 3){
        breaks = 0
        statusEl.innerHTML += `<li> 25 Mins, then 30 minutes break you deserve it! :)</li>`
    }
    // setTimeout(beep, 1000)
    beep()
})
function beep() {
    var snd = new Audio("data:audio/mpeg;base64,")
    snd.play()
}